********************************************************
PIRATE BAY SPECIAL 24bit/88.2kHz FLAC Audiophile Version
********************************************************

Doc and Lena Selyanina
Kuala Lumpur Sydney

Musictrade single release
Duration 17:59
Released on 2008-04-20 
24bit 88.2kHz FLAC encoding

This is an experimental ambient track building on field recording material from a Malaysian Airlines flight Kuala Lumpur - Sydney and on some slightly darkish variations of J.S. Bach&amp;#039;s Siciliana. The field recordings are from August 2005 and were done by Australian Musictrade artist Electroteque using a Soundman OKM binaural microphone pair.


